import React, { Component } from 'react';
import './VonzellaComp.css';

export default class VonzellaComp extends Component {
  render() {
    return (
      <div className="VonzellaPreview">

          <img src="./images/VonzellaPrev.PNG"/>

        <div className="VonDesc">
          <hr/>
          <h1>Vonzella</h1>

          <hr/>
        </div>
      </div>
    )
  }
}
